import styled from "styled-components";
export const PaginationPageWrapper  = styled.div`
    .empty {
        color: #5c5757;
        font-size: 3rem;
        width: 100%;
        height: 50vh;
        display: flex;
        justify-content: center;
        align-items: center;
        .empty-item {
            -we
        }
    }
    .paginationBttns {
        display: flex;
        justify-content: center;
        margin: 1.5rem 0;
        &> li {
            padding: 0.25rem;
            color: #000;
            font-size: 1.4rem;
            &.paginationActive {
                color: blue;
            }
            &.paginationDisabled > a {
                color: #ddd !important;
            }
        }
    }
`
